import React from "react";
import Header from "../Header";
import MovieList from "../movie/MovieList";
import MovieSearch from "../MovieSearch";

const MoviePage = () => {
  return (
    <>
      <Header></Header>
      <MovieSearch></MovieSearch>
      <MovieList></MovieList>
    </>
  );
};

export default MoviePage;
